class Home extends Component {
    constructor() {
        super();
        this.state = {
        blogs: []
        };
    }

    render() {
        return (
            <div className="Home">
                <RecommendBanner/>
                <HomeTab>
                    <BestSeller/>

                </HomeTab>
            </div>
        );
    }
}
export default Home;
